member.remarks:
Used to query for object member descriptions.
 Example:
 
 var iface=Interface.makeFrom(someobject); 
 var description = "this object has " + iface.properties + "properties, first property is " + iface.getId(0);

Vector is 1-dimensional array, indexed by integer value (starting from 0). Multidimensional arrays can
 be simulated by putting other Vector objects into the Vector.
 
 Example:
 
 var v=Vector.new();
 v.add(123); 
 v.add("string");

Dictionary associates stored values with string keys ("key" is the first argument in get/set/remove
 functions).
 Integer "key" can be used to enumerate all elements.
 
 Example:
 <code>
 var d=Dictionary.new();
 d.set("name","John");
 d.set("age",44);
 var i,element;
 for(i=0;i<d.size();i++)
     element=d.get(i);
 </code>

Manages all genotypes in the experiment, organized in one or more groups.
 Some functions refer to the "selected genotype" i.e. the genotype number "GenotypeLibrary.genotype" in the group number "GenotypeLibrary.group".
 
 For example to access the first genoype in the first group you could do:
 
 
 GenotypeLibrary.group=0;
 GenotypeLibrary.genotype=0;
 var name=Genotype.name;
 
 
 The new preferred way doesn't refer to the static Genotype object:
 
 
 var name=GenotypeLibrary.getGroup(0).getGenotype(0).name;
